import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import SunLogo from './sun-logo.png'
import { NavLink } from 'react-router-dom';
import './App.css'

const activeStyle = {
  fontWeight: 'bold',
  color: 'red',
  // add more styles as needed
};

function NavbarMain() {
  return (
    <Navbar expand="lg" className="bg-dark" variant='dark'>
      <Container>
        <Navbar.Brand href="/">
            <img src={SunLogo} alt="" className='nav-link logo-navbar' />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <NavLink to="/" className='fs-4'  activeStyle={acti}>Home</NavLink>
            <NavLink to="/products" className='fs-4'  activeStyle={acti}>Products</NavLink>
            <NavLink to="/contacts" className='fs-4'  activeStyle={acti}>Contact</NavLink>
            <NavLink to="/about" className='fs-4'  activeStyle={acti}>About Us</NavLink>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavbarMain;

